            html {
                font-family: sans-serif;
                -ms-text-size-adjust: 100%;
                -webkit-text-size-adjust: 100%

                margin: 0
            }

            }

                display: inline-block;
                vertical-align: baseline
            }

            audio:not([controls]) {
                display: none;
                height: 0
            }

                display: none
            }

            a {
                background-color: transparent
            }

            a:active,a:hover {
                outline: 0
            }

            }

            b,strong {

            }

            dfn {

            }

            }

            sub,sup {

            }

            img {

            figure {

            }

            pre {

            }

                margin: 0

            }

            button[disabled],html input[disabled] {

            }

            button::-moz-focus-inner,input::-moz-focus-inner {
                border: 0;
                padding: 0
            }

            input {
                line-height: normal
            }

            input[type="checkbox"],input[type="radio"] {

                padding: 0
            }

            input[type="number"]::-webkit-inner-spin-button,input[type="number"]::-webkit-outer-spin-button {

            input[type="search"] {

                border: 0;
                padding: 0
            }

            textarea {
                overflow: auto
            }

            optgroup {
                font-weight: bold
            }

            table {

                border-spacing: 0
            }

            td,th {
                padding: 0
            }

            body, html {
                background: #F8F8F8;
                height: 100%;
                font-family: 'Helvetica', 'Arial', sans-serif;
            }

            .clearfix:before, .clearfix:after {
                content: "";
                display: table;
            }

            .clearfix:after {
                clear: both;
            }

            .clearfix {
                zoom: 1; }

                max-width: 680px;
                margin: 0 auto;
                position: relative;
                top: 50%;

            }

            .left, .right {

                padding: 2%;

            }

            .left h1 {

                color: #444;

            .left p {

                color: #999;
            }

            .right {

            }

            img {
                max-width: 100%;
                height: auto;
            }

            /**

            @media screen and (max-width: 768px) {

                    width: 100%;
                    padding: 0;
                    text-align: center;
                    float: none;
                }

                .right {
                    margin-bottom: 30px;
                }
            }
